import React from 'react';
import { Card } from 'antd';

const Page2 = () => {
  return (
    <Card title="Página 2" style={{ width: 300, margin: 'auto', marginTop: 50, textAlign: 'center' }}>
      <p>Contenido de la Página 2</p>
    </Card>
  );
};

export default Page2;
